export function deleteRequest(id) {
  return {
    type: '@deliveryman/DELETE_REQUEST',
    payload: { id },
  };
}

export function deleteSuccess(id) {
  return {
    type: '@deliveryman/DELETE_SUCCESS',
    payload: { id },
  };
}

export function addRequest(data) {
  return {
    type: '@deliveryman/ADD_REQUEST',
    payload: { data },
  };
}
